import { Component } from "react";

class Counter extends Component {
    constructor() {
        super(); // call parent constructor

        // creating a state
        this.state = {
            counter: 0
        };
    }

    render() {
        return <h3>Count Value is: {this.state.counter} </h3>;
    }
}

export default Counter;
